import React from 'react';
import './homeComponents/home.css';
import NavBar from './homeComponents/navBar';
import BodyText from './homeComponents/bodyText';
import Credits from './homeComponents/credits';
import SignInButtonSmall from './homeComponents/signInButtonSmall';


const Home = (props) => {
    return(
        <div className={'home'}>
            <NavBar className={'home-navBar'}/>
            <BodyText className={'home-bodyText'}/>
            <SignInButtonSmall className={'home-signInButtonLarge'}/>
            <Credits className={'home-credits'}/>
        </div>
    );
};

export default Home;
